export default class Info extends React.Component {

    showInfo() {
        alert('Info')
    }

    render() {
        return (
            <div>
                <h3>{this.props.Rubrik}</h3>
                <p>{this.props.Text}</p>
                <button onClick={showInfo}>Visa</button>
            </div>
        );
    }
}
